import React from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";
  import ApiExterno from './ApiExterno'
  import App from '../App'

const Rota = () => {
    return(
        <Router>
            <Switch>
                <Route path="/" component></Route>
                <Route path="/esterno">
                    <ApiExterno/>
                </Route>
            </Switch>
        </Router>
    )
}
export default Rota;
